import { useEffect } from 'react';
import SearchUser from './seachUser'
import {connect} from "react-redux";
import {GET_USER_REPOS, getReposList, getUser} from "../../redux/actions";
import { startReposSaga } from '../../redux'

const mapDispatchToProps = dispatch => ({
    onGetRepos (user) {
        dispatch({
            type: GET_USER_REPOS,
            payload: {user}
        })
    }
})
export default connect((state) =>
        mapStateToProps,
    mapDispatchToProps
)(() =>{
    useEffect(()=>{
        startReposSaga()
    })
    return(
        <SearchUser />
    )
})
